  //    {/* <AdminNavBar/>      */}
  //     {/* <SellersNavBar/>    */}
  //      {/* <Registrationmenu/>
  //     */}

  //   </div>
  // );
  <div className="App">
  <h3 align="center">Online Job Portal</h3>
  <Router>
    {isAdminLoggedIn ? (
      <AdminNavBar />
    ) : isCustomerLoggedIn ? (
      <NavBar/> 
    ) : isSellerLoggedIn ? (
      <SellersNavBar/>
    ) : (
      <MainNavBar
        onAdminLogin={onAdminLogin}
        onJobSeekerLogin={onCustomerLogin}
        onRecruiterLogin={onSellerLogin}
      />
    )}
  </Router>
</div>
  );

}
